import React, { Component } from 'react';
import FoodMenu from '../Assets/JSON/FoodMenu.json';

class CardMenu extends Component{

  componentWillMount() {
    this.setState({
      foodMenu: FoodMenu.FoodMenus[0]
    })
  }

  render() {
    return (

      <div className="menu-card">

      </div>

      )
  }
} 

export default CardMenu;
